import React, { Component, useEffect, useState } from 'react'

const LastPlayedSong = () => {

    const [song, setSong] = useState([{}])

    useEffect(() => {
        console.log('Fetching data from backend...')
        fetch('/music/lastplayed')
            .then(response => response.json())
            .then(data => {
                setSong(data.recenttracks.track[0])
            })
    }, [])

    return (
        <div className='mt-2'>
            {(typeof song.name != 'undefined') ? (
                <div>
                    <div className='flex-row flex max-h-20'>
                        <a href={song.url} target="_blank" rel="noopener noreferrer">
                            <img src={song.image[3]['#text']} alt='Album Art' className="min-w-20 h-20" />
                        </a>
                        <div className='ml-3'>
                            <p className='song-artist leading-5 mt-1'>{song.artist['#text']}</p>
                            <p className='song-title text-xs opacity-70 mt-1'>{song.name}</p>
                        </div>
                    </div>
                    {(typeof song.date == 'undefined') ? (
                        <div className='flex-row flex place-items-center mt-3'>
                            <img src={require('./icons/vinyl.png')} className='w-5 animate-spin'></img>
                            <p className='text-xs opacity-40 ml-2'>Currently Listening</p>
                        </div>
                    ) : (
                        <div className='flex-row flex place-items-center mt-3'>
                            <img src={require('./icons/vinyl.png')} className='w-5 animate-spin'></img>
                            <p className='text-xs opacity-40 ml-2'>Played {
                                Date.now() / 1000 - song.date.uts & 60
                            }</p>
                        </div>
                    )}

                </div>
            ) : (
                <p>Loading...</p>
            )}
        </div>
    );
};

export default LastPlayedSong
